// PortIterator iterates over a range of ports
type PortIterator struct {
	ports []int
	index int
}

const BuiltinPortRankingVersion = "builtin-2026-01-02"

var builtinRankedPortsOnce sync.Once
var builtinRankedPorts []int

func getPortRankingVersion() string {
	return BuiltinPortRankingVersion
}

func getBuiltinRankedPorts() []int {
	builtinRankedPortsOnce.Do(func() {
		seen := make(map[int]struct{}, 65535)
		out := make([]int, 0, 65535)
		for _, p := range getTop100Ports() {
			if !isValidPort(p) {
				continue
			}
			if _, ok := seen[p]; ok {
				continue
			}
			seen[p] = struct{}{}
			out = append(out, p)
		}

		for _, p := range getTop600Ports() {
			if !isValidPort(p) {
				continue
			}
			if _, ok := seen[p]; ok {
				continue
			}
			seen[p] = struct{}{}
			out = append(out, p)
		}

		for _, p := range getThirdLayerPorts() {
			if !isValidPort(p) {
				continue
			}
			if _, ok := seen[p]; ok {
				continue
			}
			seen[p] = struct{}{}
			out = append(out, p)
		}
		for p := 1; p <= 65535; p++ {
			if _, ok := seen[p]; ok {
				continue
			}
			out = append(out, p)
		}
		builtinRankedPorts = out
	})
	out := make([]int, len(builtinRankedPorts))
	copy(out, builtinRankedPorts)
	return out
}

func getBuiltinTopNPorts(n int) []int {
	if n <= 0 {
		return nil
	}
	ports := getBuiltinRankedPorts()
	if len(ports) <= n {
		return ports
	}
	out := make([]int, n)
	copy(out, ports[:n])
	return out
}

func isBuiltinPortsSpec(portStr string) bool {
	switch strings.ToLower(strings.TrimSpace(portStr)) {
	case "-", "top", "full", "all", "s1", "s2", "s3", "s4", "stage1", "stage2", "stage3", "stage4", "stage-1", "stage-2", "stage-3", "stage-4",
		"s3-1", "s3-2", "s3-3", "s3-4", "s3-5", "s3-6",
		"stage3-1", "stage3-2", "stage3-3", "stage3-4", "stage3-5", "stage3-6",
		"stage-3-1", "stage-3-2", "stage-3-3", "stage-3-4", "stage-3-5", "stage-3-6":
		return true
	default:
		return false
	}
}

// NewPortIterator creates a new iterator from a string definition
// Supported formats: "80", "80,443", "100-200", "top", "full", "s1", "s2", "s3", "s4"
func NewPortIterator(portStr string) (*PortIterator, error) {
	ports := make([]int, 0)

	if portStr == "" {
		return nil, fmt.Errorf("empty port string")
	}

	// Handle special keywords
	normalized := strings.ToLower(strings.TrimSpace(portStr))
	if normalized == "-" {
		normalized = "full"
	}
	if normalized == "top-100" {
		return nil, fmt.Errorf("unsupported ports keyword 'top-100', use 'top'")
	}
	if normalized == "top-1000" {
		return nil, fmt.Errorf("unsupported ports keyword 'top-1000', use 'top' or 'full'")
	}
	if normalized == "top-10000" {
		return nil, fmt.Errorf("unsupported ports keyword 'top-10000', use 'top' or 'full'")
	}

	if normalized == "top" {
		s1, s2, _, _ := BuildStagePorts(nil)
		ports = append(ports, s1...)
		ports = append(ports, s2...)
		return &PortIterator{ports: ports}, nil
	}

	if normalized == "s1" || normalized == "stage1" || normalized == "stage-1" {
		ports = getTop100Ports()
		return &PortIterator{ports: ports}, nil
	}

	if normalized == "s2" || normalized == "stage2" || normalized == "stage-2" {
		_, s2, _, _ := BuildStagePorts(nil)
		return &PortIterator{ports: s2}, nil
	}

	if strings.HasPrefix(normalized, "s3-") {
		partIdx, err := strconv.Atoi(strings.TrimPrefix(normalized, "s3-"))
		if err == nil && partIdx >= 1 && partIdx <= 6 {
			_, _, s3Parts, _ := buildStagePortsWithS3Parts(nil)
			if len(s3Parts) >= partIdx {
				return &PortIterator{ports: s3Parts[partIdx-1]}, nil
			}
		}
	}
	if strings.HasPrefix(normalized, "stage3-") {
		partIdx, err := strconv.Atoi(strings.TrimPrefix(normalized, "stage3-"))
		if err == nil && partIdx >= 1 && partIdx <= 6 {
			_, _, s3Parts, _ := buildStagePortsWithS3Parts(nil)
			if len(s3Parts) >= partIdx {
				return &PortIterator{ports: s3Parts[partIdx-1]}, nil
			}
		}
	}
	if strings.HasPrefix(normalized, "stage-3-") {
		partIdx, err := strconv.Atoi(strings.TrimPrefix(normalized, "stage-3-"))
		if err == nil && partIdx >= 1 && partIdx <= 6 {
			_, _, s3Parts, _ := buildStagePortsWithS3Parts(nil)
			if len(s3Parts) >= partIdx {
				return &PortIterator{ports: s3Parts[partIdx-1]}, nil
			}
		}
	}

	if normalized == "s3" || normalized == "stage3" || normalized == "stage-3" {
		_, _, s3, _ := BuildStagePorts(nil)
		return &PortIterator{ports: s3}, nil
	}

	if normalized == "s4" || normalized == "stage4" || normalized == "stage-4" {
		_, _, _, s4 := BuildStagePorts(nil)
		return &PortIterator{ports: s4}, nil
	}

	if normalized == "full" || normalized == "all" {
		ports = getBuiltinRankedPorts()
		return &PortIterator{ports: ports}, nil
	}

	parts := strings.Split(portStr, ",")
	for _, part := range parts {
		part = strings.TrimSpace(part)
		if strings.Contains(part, "-") {
			rangeParts := strings.Split(part, "-")
			if len(rangeParts) != 2 {
				continue
			}
			start, err1 := strconv.Atoi(rangeParts[0])
			end, err2 := strconv.Atoi(rangeParts[1])
			if err1 == nil && err2 == nil && start <= end {
				for i := start; i <= end; i++ {
					if isValidPort(i) {
						ports = append(ports, i)
					}
				}
			}
		} else {
			port, err := strconv.Atoi(part)
			if err == nil && isValidPort(port) {
				ports = append(ports, port)
			}
		}
	}

	// Remove duplicates
	ports = removeDuplicateInt(ports)

	return &PortIterator{ports: ports}, nil
}

