func removeDuplicateInt(intSlice []int) []int {
	keys := make(map[int]bool)
	list := []int{}
	for _, entry := range intSlice {
		if _, value := keys[entry]; !value {
			keys[entry] = true
			list = append(list, entry)
		}
	}
	return list
}

func isValidPort(p int) bool {
	return p > 0 && p <= 65535
}

func LoadRankedPortsFile(filePath string) ([]int, error) {
	b, err := os.ReadFile(filePath)
	if err != nil {
		return nil, err
	}
	return ParseRankedPorts(string(b)), nil
}

func ParseRankedPorts(s string) []int {
	splits := strings.FieldsFunc(s, func(r rune) bool {
		return r == ',' || r == '\n' || r == '\r' || r == '\t' || r == ' '
	})
	seen := make(map[int]struct{}, len(splits))
	out := make([]int, 0, len(splits))
	for _, tok := range splits {
		tok = strings.TrimSpace(tok)
		if tok == "" {
			continue
		}
		if strings.HasPrefix(tok, "U:") || strings.HasPrefix(tok, "u:") {
			continue
		}
		if strings.Contains(tok, "-") {
			continue
		}
		n, err := strconv.Atoi(tok)
		if err != nil || !isValidPort(n) {
			continue
		}
		if _, ok := seen[n]; ok {
			continue
		}
		seen[n] = struct{}{}
		out = append(out, n)
	}
	return out
}

func getThirdLayerPortsParts() [][]int {
	ports := getThirdLayerPorts()
	if len(ports) == 0 {
		return nil
	}

	startMarkers := []int{8013, 8301, 8900, 10003, 20001}
	bounds := make([]int, 0, 7)
	bounds = append(bounds, 0)
	for _, m := range startMarkers {
		idx := -1
		for i, p := range ports {
			if p == m {
				idx = i
				break
			}
		}
		if idx <= 0 {
			bounds = nil
			break
		}
		bounds = append(bounds, idx)
	}
	if bounds != nil {
		bounds = append(bounds, len(ports))
		for i := 1; i < len(bounds); i++ {
			if bounds[i] <= bounds[i-1] {
				bounds = nil
				break
			}
		}
	}

	if bounds == nil {
		out := make([][]int, 0, 6)
		for i := 0; i < 6; i++ {
			start := i * len(ports) / 6
			end := (i + 1) * len(ports) / 6
			out = append(out, ports[start:end])
		}
		return out
	}

	out := make([][]int, 0, 6)
	for i := 0; i < 6; i++ {
		out = append(out, ports[bounds[i]:bounds[i+1]])
	}
	return out
}

func buildStagePortsWithS3Parts(rankedPorts []int) (s1 []int, s2 []int, s3Parts [][]int, s4 []int) {
	_ = rankedPorts
	s1 = removeDuplicateInt(getTop100Ports())

	union := intSetFromSlice(s1)
	s2 = diffPorts(removeDuplicateInt(getTop600Ports()), union)
	for _, p := range s2 {
		union[p] = struct{}{}
	}

	rawParts := getThirdLayerPortsParts()
	s3Parts = make([][]int, 0, 6)
	for _, part := range rawParts {
		partPorts := diffPorts(removeDuplicateInt(part), union)
		s3Parts = append(s3Parts, partPorts)
		for _, p := range partPorts {
			union[p] = struct{}{}
		}
	}

	s4 = make([]int, 0, 65535-len(union))
	for p := 1; p <= 65535; p++ {
		if _, ok := union[p]; ok {
			continue
		}
		s4 = append(s4, p)
	}

	return
}

func BuildStagePorts(rankedPorts []int) (s1 []int, s2 []int, s3 []int, s4 []int) {
	s1, s2, s3Parts, s4 := buildStagePortsWithS3Parts(rankedPorts)
	for _, part := range s3Parts {
		s3 = append(s3, part...)
	}
	return s1, s2, s3, s4
}

func ChunkPorts(ports []int, chunkSize int) [][]int {
	if chunkSize <= 0 {
		return [][]int{ports}
	}
	if len(ports) == 0 {
		return nil
	}
	chunks := make([][]int, 0, (len(ports)+chunkSize-1)/chunkSize)
	for i := 0; i < len(ports); i += chunkSize {
		j := i + chunkSize
		if j > len(ports) {
			j = len(ports)
		}
		chunks = append(chunks, ports[i:j])
	}
	return chunks
}

func takeFirstNPorts(ports []int, n int) []int {
	if n <= 0 || len(ports) == 0 {
		return nil
	}
	if len(ports) <= n {
		out := make([]int, len(ports))
		copy(out, ports)
		return out
	}
	out := make([]int, n)
	copy(out, ports[:n])
	return out
}

func intSetFromSlice(ports []int) map[int]struct{} {
	m := make(map[int]struct{}, len(ports))
	for _, p := range ports {
		m[p] = struct{}{}
	}
	return m
}

func diffPorts(ports []int, exclude map[int]struct{}) []int {
	if len(ports) == 0 {
		return nil
	}
	out := make([]int, 0, len(ports))
	for _, p := range ports {
		if _, ok := exclude[p]; ok {
			continue
		}
		out = append(out, p)
	}
	return out
}

func (pi *PortIterator) Next() (int, bool) {
	if pi.index >= len(pi.ports) {
		return 0, false
	}
	port := pi.ports[pi.index]
	pi.index++
	return port, true
}

func (pi *PortIterator) Reset() {
	pi.index = 0
}

func (pi *PortIterator) Total() int {
	return len(pi.ports)
}

// HostIterator iterates over a list of hosts/IPs
type HostIterator struct {
	hosts []string
	index int
}

func (hi *HostIterator) Reset() {
	hi.index = 0
}

// NewHostIterator creates a new iterator from a list of targets
func NewHostIterator(targets []string) *HostIterator {
	var expandedHosts []string
	for _, t := range targets {
		// CIDR expansion
		if strings.Contains(t, "/") {
			if strings.HasSuffix(t, "/8") {
				if ips := sampleSubnet8(t); len(ips) > 0 {
					expandedHosts = append(expandedHosts, ips...)
					continue
				}
			} else {
				if ips, err := ipRangeFromCIDR(t); err == nil {
					expandedHosts = append(expandedHosts, ips...)
					continue
				}
			}
		}
		// IP Range expansion (e.g. 192.168.1.1-192.168.1.10)
		if strings.Contains(t, "-") {
			if ips, err := ipRangeFromRange(t); err == nil {
				expandedHosts = append(expandedHosts, ips...)
				continue
			}
		}
		expandedHosts = append(expandedHosts, t)
	}

	// Remove duplicates
	expandedHosts = removeDuplicateStr(expandedHosts)

	return &HostIterator{hosts: expandedHosts}
}

func (hi *HostIterator) Next() (string, bool) {
	if hi.index >= len(hi.hosts) {
		return "", false
	}
	host := hi.hosts[hi.index]
	hi.index++
	return host, true
}

func (hi *HostIterator) Shuffle() {
	rand.Shuffle(len(hi.hosts), func(i, j int) {
		hi.hosts[i], hi.hosts[j] = hi.hosts[j], hi.hosts[i]
	})
	hi.index = 0
}

func (hi *HostIterator) GetHosts() []string {
	return hi.hosts
}

func (hi *HostIterator) Total() int {
	return len(hi.hosts)
}

func ipRangeFromCIDR(cidr string) ([]string, error) {
	ip, ipnet, err := net.ParseCIDR(cidr)
	if err != nil {
		return nil, err
	}

	var ips []string
	for ip := ip.Mask(ipnet.Mask); ipnet.Contains(ip); inc(ip) {
		ips = append(ips, ip.String())
	}
	// Remove network address and broadcast address
	if len(ips) > 2 {
		return ips[1 : len(ips)-1], nil
	}
	return ips, nil
}

func inc(ip net.IP) {
	for j := len(ip) - 1; j >= 0; j-- {
		ip[j]++
		if ip[j] > 0 {
			break
		}
	}
}

func ipRangeFromRange(rangeStr string) ([]string, error) {
	parts := strings.Split(rangeStr, "-")
	if len(parts) != 2 {
		return nil, fmt.Errorf("invalid range format")
	}

	startIP := net.ParseIP(parts[0])
	endIP := net.ParseIP(parts[1])

	if startIP == nil || endIP == nil {
		return nil, fmt.Errorf("invalid IP in range")
	}

	var ips []string
	for ip := startIP; !ip.Equal(endIP); inc(ip) {
		ips = append(ips, ip.String())
	}
	ips = append(ips, endIP.String())

	return ips, nil
}

func removeDuplicateStr(strSlice []string) []string {
	keys := make(map[string]bool)
	list := []string{}
	for _, entry := range strSlice {
		if _, value := keys[entry]; !value {
			keys[entry] = true
			list = append(list, entry)
		}
	}
	return list
}

func sampleSubnet8(cidr string) []string {
	base := cidr[:len(cidr)-2]
	parts := strings.Split(base, ".")
	if len(parts) != 4 {
		return nil
	}
	first := parts[0]
	var res []string
	commonSeconds := []int{0, 1, 2, 10, 100, 200, 254}
	for _, s := range commonSeconds {
		for t := 0; t < 256; t += 10 {
			res = append(res, firstDot(first, s, t, 1))
			res = append(res, firstDot(first, s, t, 254))
			res = append(res, firstDot(first, s, t, 2+rand.IntN(252)))
		}
	}
	for s := 0; s < 256; s += 32 {
		for t := 0; t < 256; t += 32 {
			res = append(res, firstDot(first, s, t, 1))
			res = append(res, firstDot(first, s, t, 2+rand.IntN(252)))
		}
	}
	return res
}

func firstDot(a string, b, c, d int) string {
	return fmt.Sprintf("%s.%d.%d.%d", a, b, c, d)
}
